import './App.css';
import Post from './Post.js';
import { posts } from './data.js'



function App() {
  return (
    <div className="App">
     <Feed/>
    </div>
  );
}

function Feed() {
  return (
  <Post post={posts[0]}/>
  )
}

export default App;
